import React, { useState } from 'react';

function Header() {
    const [employee, setEmployee] = useState([
        {name:"Suraj",
        age:29,
        address:"Delhi"
    }
    ]);

    const handerColor = () => {
        setEmployee("Green")
    }
    return (
        <div>
            <ul>
                {
                    employee.map((name)=>{
                        <li>{name.name}</li>
                    })
                }
            </ul>
            <button type="button" onClick={() => setEmployee({name:"Ravi",
        age:33,
        address:"Gurgaon"})}>click me!</button>
        </div>
    )
}

export default Header;
